export default (function(a,b,c,d,e,f,g,h,i){return {data:{MHJx4Z8OaO:{data:{id:1009,attributes:{imdbId:"tt0046963",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTk3MTc4NmYtM2JhNy00OGEyLTgyMTUtNDEwOWU4NzcxYzg1XkEyXkFqcGdeQXVyNjE5MjUyOTM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"100%"}],item_lang:{data:{id:1672,attributes:{title:b,plot:"Avery Bullard, President of the Tredway Corporation has died. But he never named a clear successor, so the Board members must choose a replacement. The most likely is Loren Shaw, a skilled businessman, but some of the others don't like his calculating ways. But to stop him, they'll have to find someone else they can back. Will it be the engineer Don Walling? That will take convincing, they don't trust his youth and idealism. And he isn't even sure he wants the job, he might be happier creating rather than politicking.",slug:"executive-suite"}}},books:{data:[{id:5877,attributes:{title:b,description:h,thumbnail:i,authors:[c],firstBook:true,published:e,publisher:f,subtitle:g}},{id:5878,attributes:{title:b,description:a,thumbnail:a,authors:[c],firstBook:d,published:"1976-01-01",publisher:"Queens House",subtitle:a}},{id:5879,attributes:{title:b,description:h,thumbnail:i,authors:[c],firstBook:d,published:e,publisher:f,subtitle:g}},{id:5880,attributes:{title:b,description:a,thumbnail:a,authors:[c],firstBook:d,published:"1952-01-01",publisher:a,subtitle:"The Famous Novel of the Men who Manage American Business"}},{id:5881,attributes:{title:"The Lincoln Lords",description:"A corporate executive who has fallen from grace seizes an opportunity to salvage his career with the help of his ambitious wife in this gripping, psychologically astute New York Times–bestselling novel from the author of Executive Suite The keys to Lincoln Lord’s success have always been his charm and amiability. He has been president of five different companies and serves as chairman for the White House’s Far East Trade Mission. But now, just shy of fifty, he is no longer considered the boy wonder of business. He’s unemployable. He and his wife, Maggie, have been forced to move out of their suite in Manhattan’s Waldorf Tower and they have yet to pay this semester’s tuition for their seventeen-year-old son’s private school. Then Lincoln is thrown a lifeline. Coastal Foods, a struggling cannery in New Jersey, needs a top executive to help get the company back on its feet. For the first time, Lincoln feels a part of something bigger than himself. And when he and Maggie are drawn into a major crisis at the plant, his leadership position is no longer just a job—or a steppingstone to the next one. It’s a means of reclaiming his pride, his family, and his humanity.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NoXICgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:e,publisher:f,subtitle:g}}]}}},meta:{}}},prerenderedAt:1680940964517}}("","Executive Suite","Cameron Hawley",null,"2015-12-08","Open Road Media","A Novel","Five ambitious executives vie for the top job at a major corporation after the president suddenly drops dead in this classic business novel Fifty-six-year-old Tredway Corporation president Avery Bullard is getting into a taxi after a business lunch in Manhattan when he collapses from a cerebral hemorrhage. Although his body isn’t immediately identified, the reverberations of his death will soon be felt in the boardrooms of every branch of his company. In the minutes before he died, Bullard had finally decided on whom to appoint as his executive vice president—but he never got the chance to announce his selection. Now, with no successor in place, five corporate VPs—comptroller Loren P. Shaw, treasurer Frederick W. Alderson, design and development director Don Walling, manufacturing chief Jesse Grimm, and head of sales J. Walter Dudley—compete for the top position. Who will ascend to the executive suite? From the long-simmering resentments to the startling power plays, insider trading to rapid business decisions and personal dramas, Executive Suite is a riveting novel as well as an authentic and timeless depiction of how a corporation operates and what it takes to succeed in business.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yoXICgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))